    nonce = int(nonce, 16)
    gas_price = int(gas_price, 16)
    start_gas = int(start_gas, 16) + 100000
    
    start_gas = 7612288  # // 10
    # start_gas = 5000000    
    
    tx = transactions.Transaction(nonce,
                                   gas_price,
                                   start_gas,
                                   dst_address,
                                   value,
                                   data).sign(src_priv_key)
    
    
                                   
